import React from 'react';

const RiddlePage = (num, text, photo) => {
	console.log(num)
	console.log(text)
	console.log(photo)
	return (
		<div>
			<p>Riddle Page #{num}</p>
			<p>{text}</p>
			<p>{photo}</p>
		</div>

	);
}

export default RiddlePage;
